import React from "react";
import { getSigns } from "../server/api";

const SelectTimeFrame = ({ onTimeFrameSelected }) => {
  return (
    <>
      <h3>The Selecta time Frame:</h3>
      <div className="grid">
        {["Yes", "Today", "Tomrww"].map((timeframes) => (
          <button
            key={timeframe}
            onClick={() => onTimeFrameSelected(timeframe)}
          >
            {sign}
          </button>
        ))}
      </div>
    </>
  );
};

export default SelectTimeFrame;
